import "./index.css";
import React, { useState } from "react";
import ReactDOM from "react-dom/client";
import restaurantData from "./restaurantData";
const HeaderLogo = "data:image/png;base64,";
const RatingIcon = "data:image/svg+xml; charset=utf-8;utf8;base64,";
const RupeeIcon = "data:image/svg+xml; charset=utf-8;utf8;base64,";

const Header = () => {
  return (
    <header className="header">
      <div className="logo-container">
        <img className="logo" src={HeaderLogo} alt="Logo" />
      </div>
      <div className="nav-items">
        <ul className="nav-list">
          <li className="nav-item">Home</li>
          <li className="nav-item">About</li>
          <li className="nav-item">Contact</li>
          <li className="nav-item">Cart</li>
        </ul>
      </div>
    </header>
  );
};

const styleCards = {
  padding: "10px",
  width: "200px",
};

const RestaurantCard = (props) => {
  const { resName, cuisines, rating, Dtime, IMGSRC, priceForTwo } = props;
  const forTwo=priceForTwo*2

  return (
    <div className="res-card" style={styleCards}>
      <img className="food-img" alt={`${resName} dish`} src={IMGSRC} />
      <h3>{resName}</h3>
      <div className="TimeRating"> <span style={{ display: "flex" }}> <img className="rIcon" alt="star" src={RatingIcon} /> {rating} </span> <span>{Dtime} min</span> </div>
      <h5 id="desc">{cuisines}</h5>
      <h4 style={{ display: "flex" }}> <img className="rIcon" alt="rupee" src={RupeeIcon} /> {forTwo} {" "}FOR TWO </h4>
    </div>
  );
};

const Body = () => {
 

  return (
    <div className="Body">
      <div className="Search">
        <input type="text" placeholder="Search restaurants..." />
      </div>
      <div className="res-container">
        {restaurantData.data.map((restaurant) => (
          <RestaurantCard
            key={restaurant.id}
            resName={restaurant.name}
            cuisines={restaurant.cuisine.join(", ")}
            rating={restaurant.rating}
            IMGSRC={restaurant.image}
            menu={restaurant.menu}
            Dtime={restaurant.deliveryTime}
            priceForTwo={restaurant.menu[0].price}
          />
        ))}
      </div>
    </div>
  );
};

const App = () => {
  return (
    <div className="app">
      <Header />
      <Body />
    </div>
  );
};

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<App />);
